import React, { Component } from "react";
import Tabs from "react-bootstrap/Tabs";
import Tab from "react-bootstrap/Tab";
import Education from "./education";

class Navbar extends Component {
  state = {
    tabs: [
      { id: 1, title: "BACKGROUND", component: "" },
      { id: 2, title: "EDUCATION", component: <Education /> },
      { id: 3, title: "EXPERIENCE", component: "" },
      { id: 4, title: "SKILLS", component: "" },
      { id: 5, title: "SOFTWARE", component: "" }
    ]
  };

  render() {
    return (
      <Tabs justify defaultActiveKey="1">
        {this.state.tabs.map(tab => (
          <Tab eventKey={tab.id} title={tab.title}>
            {tab.component}
          </Tab>
        ))}
      </Tabs>
    );
  }
}

export default Navbar;
